CREATE FUNCTION factorial (n DECIMAL(3,0))
RETURNS DECIMAL(20,0) DETERMINISTIC
BEGIN
DECLARE factorial DECIMAL(20,0) DEFAULT 1;
DECLARE counter DECIMAL(3,0);
SET counter = n;
factorial_loop REPEAT
SET factorial = factorial * counter;
SET counter = counter - 1;
UNTIL counter = 1
END REPEAT;
RETURN factorial;
END //

 // JavaScript (shopping.js)

// Sample book data
const books = [
    { id  1, title  'Book 1', price  10 },
    { id  2, title  'Book 2', price  15 },
    { id  3, title  'Book 3', price  20 },
];

// Initialize the cart as an empty array
let cart = [];

// Function to display books in the bookList div
function displayBooks() {
    const bookListDiv = document.getElementById('bookList');
    bookListDiv.innerHTML = '';

    books.forEach(book => {
        const bookDiv = document.createElement('div');
        bookDiv.innerHTML = `${book.title} - $${book.price} <button onclick="addToCart(${book.id})">Add to Cart</button>`;
        bookListDiv.appendChild(bookDiv);
    });
}

// Function to add a book to the cart
function addToCart(bookId) {
    const book = books.find(b => b.id === bookId);
    if (book) {
        const cartItem = cart.find(item => item.id === bookId);

        if (cartItem) {
            cartItem.quantity++;
        } else {
            cart.push({ id  bookId, title  book.title, price  book.price, quantity 1 });
        }

        displayCart();
    }
}

// Function to remove a book from the cart
function removeFromCart(bookId) {
    const cartItemIndex = cart.findIndex(item => item.id === bookId);
    if (cartItemIndex !== -1) {
        cart.splice(cartItemIndex, 1);
        displayCart();
    }
}

// Function to display the cart
function displayCart() {
    const cartItemsDiv = document.getElementById('cartItems');
    cartItemsDiv.innerHTML = '';

    cart.forEach(item => {
        const cartItemDiv = document.createElement('div');
        cartItemDiv.innerHTML = `${item.title} - $${item.price} x ${item.quantity} <button onclick="removeFromCart(${item.id})">Remove</button>`;
        cartItemsDiv.appendChild(cartItemDiv);
    });
}

// Initial display
displayBooks();
displayCart();
